import React from 'react';
import LargeButton from '../components/LargeButton';
import { useNavigate } from 'react-router-dom';

const Home = () => {

    const navigate = useNavigate();

    return (
        <div className='absolute top-1/4 lg:mt-5 flex lg:flex-row flex-col w-full lg:gap-x-20 gap-y-20 px-10 lg:w-1/2 lg:left-1/4'>
            <LargeButton
                colour='blue'
                label="Skills & Education"
                desc="Coding languages, technologies, and educational accomplishments"
                onClick={() => navigate('/skills')}
                className='w-1/2'
            />
            <LargeButton
                colour='yellow'
                label="Projects & Experience"
                desc="Exhibit of personal projects and work experiences"
                onClick={() => navigate('/projects')}
                className='w-1/2'
            />

        </div>
    );
};

export default Home;
